/**
 * 快速排序
 * 1.找到基准值
 * 2.分割成两个子数组
 *  小于基准值，大于基准值
 *  对子数组再次进行快速排序
 */
function dc2(list) {
    if (list.length < 2) {
        return list;
    }
    let rightList = [],
        leftList = [],
        midIndex = parseInt(list.length / 2),
        midValue = list[midIndex];
    list.forEach((i, index) => {
        if (i <= midValue && midIndex !== index) {
            leftList.push(i);
        } else if (i > midValue && midIndex !== index) {
            rightList.push(i);
        }
    });
    return [...dc2(leftList), midValue, ...dc2(rightList)];
}




